import Centaur from "../../src/strategy/classes/unitInfo/CentaurUnitInfo";
import ElfArcher from "../../src/strategy/classes/unitInfo/ElfArcherUnitInfo";
import Monk from "../src/../strategy/classes/unitInfo/MonkUnitInfo";
import Sirena from "../src/../strategy/classes/unitInfo/SirenaUnitInfo";
import SkeletonMage from "../../src/strategy/classes/unitInfo/SkeletonMageUnitInfo";
import Skeleton from "../src/../strategy/classes/unitInfo/SkeletonMageUnitInfo";
const allUnits: object[] = [
  ArchiMage,
  Bandit,
  Centaur,
  ElfArcher,
  Monk,
  Sirena,
  Skeleton,
  SkeletonMage
];
// export const randomIndex: number = Math.floor(Math.random() * 8);
// export const randomUnit: object = allUnits[randomIndex];
export const giveUnitType: any = () => {
  const randomIndex: number = Math.floor(Math.random() * 8);
  const randomUnit: object = allUnits[randomIndex];
  return;
};
